
using System.Runtime.InteropServices;

public class LeetCodeTemplate
{


    public static void Main()
    {
        string s = "",
                t = "";


        char returned = LeetCodeTemplate.Problem(s, t);



        return;


    }


    public static char Problem(string s, string t)
    {
        char returnChar = '\0';

        if (s.Length > 1000)
            return returnChar;
        

        if(t.Length != s.Length + 1)
            return returnChar;

        char[] sarray = s.ToCharArray();

        for (int i = 0; i < t.Length; i++)
        {
            if (sarray.Contains(t[i]))
            {
                //s = s.(t[i], '\0');
                for (int j = 0; j < sarray.Length; j++)
                {
                    if (sarray[j] == t[i])
                    {
                        sarray[j] = '\0';
                        break;
                    }
                }

                continue;
            }
            returnChar = t[i];
            break;
        }


        return returnChar;
    }





} // EOC
